import React from 'react';
import styled from 'styled-components';


const Slidebar = (props) => {
  return (
    <Scroll>
    	{props.children}
    </Scroll>
  )
}

export default Slidebar;


const Scroll=styled.div `
 overflow-y: scroll;
 border: 1em;
`;
